import React from 'react';
import {
    Navbar,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink
  } from "shards-react";

  const MyTheme = {
    "data" : {
      "light" : {
        "id": "T_001",
        "name": "Light",
        "colors": {
          "body": "#FFFFFF",
          "text": "#000000",
          "button": {
            "text": "#FFFFFF",
            "background": "#000000"
          },
          "link": {
            "text": "teal",
            "opacity": 1
          }
        },
        "font": "Tinos"
      },
      "seaWave" : {
        "id": "T_007",
        "name": "Sea Wave",
        "colors": {
          "body": "#9be7ff",
          "text": "#0d47a1",
          "button": {
            "text": "#ffffff",
            "background": "#0d47a1"
          },
          "link": {
            "text": "#0d47a1",
            "opacity": 0.8
          }
        },
        "font": "Ubuntu"
      }
    }
  }

class MenuBar extends React.Component {
    render() {
        return(
            <Navbar theme={MyTheme} expand="md">
        <NavbarBrand href="/">FitCheck</NavbarBrand>
          <Nav navbar>
          <NavItem>
              <NavLink active href="/clothing_suggest">
                Clothing Suggestions
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink active href="/product_info">
                Clothing Info
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink active  href="/amazon_suggest" >
                Amazon Specific Suggestions
              </NavLink>
            </NavItem>
          </Nav>
      </Navbar>
        )
    }
}

export default MenuBar
